function transdate(endTime){
	var date=new Date();
	date.setFullYear(endTime.substring(0,4));
	date.setMonth(endTime.substring(5,7)-1);
	date.setDate(endTime.substring(8,10));
	date.setHours(endTime.substring(11,13));
	date.setMinutes(endTime.substring(14,16));
	date.setSeconds(endTime.substring(17,19));
	return Date.parse(date)/1000;
}

//思路：
//
//1.构建一个新的数组存放结果
//
//2.for循环中每次从原数组中取出一个元素，用这个元素循环与结果数组对比
//
//3.若结果数组中没有该元素，则存到结果数组中

Array.prototype.unique1 = Array.prototype.unique1 || function () {
	var time = new Date();
	console.log(time.getTime());
	var res = [this[0]];
	for (var i = 1; i < this.length; i++) {
		var repeat = false;
		for (var j = 0; j < res.length; j++) {
			if(this[i] == res[j]){
				repeat = true;
				break;
			}
		}
		if(!repeat){
			res.push(this[i]);
		}
	}
	var time2 = new Date();
	console.log(time2.getTime());
	return res;
}

//思路：
//
//1.先将原数组进行排序
//
//2.检查原数组中的第i个元素 与 结果数组中的最后一个元素是否相同，因为已经排序，所以重复元素会在相邻位置
//
//3.如果不相同，则将该元素存入结果数组中
Array.prototype.unique2 = Array.prototype.unique2 || function(){
	var time = new Date();
	console.log(time.getTime());
	this.sort();
	var res = [this[0]];
	for (var i = 1; i < this.length; i++) {
		if(this[i] != res[res.length - 1] ){
			res.push(this[i]);
		}
	}
	var time2 = new Date();
	console.log(time2.getTime());
	return res;
}

//1.创建一个新的数组存放结果
//
//2.创建一个空对象
//
//3.for循环时，每次取出一个元素与对象进行对比，如果这个元素不重复，则把它存放到结果数组中，
//同时把这个元素的内容作为对象的一个属性，并赋值为1，存入到第2步建立的对象中。
//
//说明：至于如何对比，就是每次从原数组中取出一个元素，然后到对象中去访问这个属性，如果能访问到值，则说明重复。

Array.prototype.unique3 = Array.prototype.unique3 || function () {
	var time = new Date();
	console.log(time.getTime());
	var res = [];
	var json = {};
	for (var i = 0; i < this.length; i++) {
		if(!json[this[i]]){
			res.push(this[i]);
			json[this[i]] = 1;
		}
	}
	var time2 = new Date();
	console.log(time2.getTime());
	return res;
}

